import React from "react";
import {Image} from "@nextui-org/react";

export default function App() {
  return (
    <Image
      isZoomed
      width={240}
      alt="NextUI Fruit Image with Zoom"
      src="https://nextui-docs-v2.vercel.app/images/fruit-1.jpeg"
    />
  );
}
